// Routing.js-module

import React from "react"
//router_package
 import { BrowserRouter,Route,Link } from "react-router-dom";
// component_nesting_into_routings

import Home from './MainMenu/Home';
import About from './MainMenu/About';
 import Services from './MainMenu/Services'
import Contact from './MainMenu/Contact';



//Create Home Component
function Routings()
{
  
  return  (<BrowserRouter>

          {/* LINKS FOR MENU*/}


          {/*<a href="home.html">Home</a>*/}

          <Link to="/home">Home</Link> &nbsp;&nbsp;

          {/*<a href="about.html">Home</a>*/}
          <Link to="/about">About</Link> &nbsp;&nbsp;

          {/*<a href="services.html">Home</a>*/}
          <Link to="/services">Services</Link> &nbsp;&nbsp;

          {/*<a href="contact.html">Home</a>*/}
          <Link to="/contact">Contact</Link> &nbsp;&nbsp;

             <br /> <br /> <br />

          {/* LINKS FOR MENU */}  

        {/*<load Default  page as component from localhos />*/} 
        <Route path="/home" component={Home} />

       <Route exact path="/" component={Home} />
        {/*<Home />*/}
        <Route path="/home" component={Home} />
        
         {/*<About />*/}
        <Route path="/about" component={About} />
         
         {/*<Services/>*/}
         <Route path="/services" component={Services} />

        {/*<Contact />*/}
        <Route path="/contact" component={Contact} />

  </BrowserRouter>)
  
}

export default Routings;
